    data: |
      SELECT ALL - + col2 FROM tab1 (FORMAT parquet) WHERE NOT col0 * + + 61 * + ( + col1 ) + + col0 + 87 * - + col1 * 27 - + col2 IS NULL;
  - name: tab1

outputs:
  - name: q11893.out
    data: |
      -59
      -68
      -96
